import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  width: 100%;
  height: 100%;
  background-color: green;
  margin-bottom: 3px;
`;

const MarketRankP = styled.p``;
const NameP = styled.p``;
const SymbolP = styled.p``;
const Img = styled.p``;
const PriceP = styled.p``;
const PriceChange24 = styled.p``;
const VolumeP = styled.p``;

const CoinHandler = ({ coin: {market_cap_rank: marketCapRank, } }) => {
  console.log(coin);
  return (
    <Wrapper>
      <MarketRankP></MarketRankP>
      <NameP></NameP>
      <SymbolP></SymbolP>
      <Img></Img>
      <PriceP></PriceP>
      <PriceChange24></PriceChange24>
      <VolumeP></VolumeP>
    </Wrapper>
  );
};

export default CoinHandler;
